import React, { useState } from "react";

export default function Home() {
  const [state, setstate] = useState(0);

  return (
    <div>
      <h1>ProKickballer</h1>
      <div>
        <h3>Home Team</h3>
        <button onClick={() => setstate(this.state + 1)}>
          Score: {this.state}
        </button>
      </div>
      <div>
        <h3>Away Team</h3>
        <button onClick={() => setstate(this.state + 1)}>
          Score: {this.state}
        </button>
      </div>
    </div>
  );
}
